import React from 'react';

class ChangingText extends React.Component {
  constructor(props) {
    super(props);
  }

  componentDidMount() {
    this.timerID = setInterval(
      () => this.tick(),
      1000
    );
  }

  componentWillMount() {
    clearInterval(this.timerID);
  }

  tick() {
    this.setState({
      date: new Date()
    });
  }

  render() {
    return(
      <div className="Info-occu">
	    {this.state.title};
      </div>
    );
  }
}
